import React, { useEffect, useState } from "react";

function QuizApp() {
  const [studentData, setStudentData] = useState(null);
  const [examConfig, setExamConfig] = useState(null);
  const [timeLeft, setTimeLeft] = useState(30 * 60); // 30 ph√∫t t√≠nh b·∫±ng gi√¢y
  const [answers, setAnswers] = useState([]);

  // Load d·ªØ li·ªáu t·ª´ localStorage
  useEffect(() => {
    const storedStudent = JSON.parse(localStorage.getItem("studentData"));
    const storedExam = JSON.parse(localStorage.getItem("examConfig"));
    
    // Ki·ªÉm tra n·∫øu d·ªØ li·ªáu t·ªìn t·∫°i
    if (storedStudent && storedExam) {
      setStudentData(storedStudent);
      setExamConfig(storedExam);
    } else {
      console.log("D·ªØ li·ªáu kh√¥ng c√≥ trong localStorage.");
    }
  }, []);

  // Ch·ªù khi d·ªØ li·ªáu ƒë∆∞·ª£c load t·ª´ localStorage
  if (!studentData || !examConfig) return <p>ƒêang t·∫£i d·ªØ li·ªáu...</p>;

  // X·ª≠ l√Ω khi examConfig v√† studentData ƒë√£ c√≥ s·∫µn
  const exam = examConfig.examCodes.find(
    (e) => e.code === studentData.examCode
  );

  useEffect(() => {
    if (exam) {
      setAnswers(new Array(exam.questionsData.length).fill(null));
    }
  }, [exam]);

  // H√†m ƒë·∫øm ng∆∞·ª£c th·ªùi gian
  useEffect(() => {
    const timer = setInterval(() => {
      setTimeLeft((prev) => {
        if (prev <= 0) {
          clearInterval(timer); // D·ª´ng l·∫°i khi h·∫øt th·ªùi gian
          return 0;
        }
        return prev - 1;
      });
    }, 1000);

    return () => clearInterval(timer); // Cleanup khi component unmount
  }, []);

  const handleAnswerChange = (index, value) => {
    const updated = [...answers];
    updated[index] = value;
    setAnswers(updated);
  };

  const handleSubmit = () => {
    console.log("B√†i l√†m c·ªßa sinh vi√™n:", answers);
    alert("‚úÖ N·ªôp b√†i th√†nh c√¥ng!");
    // TODO: Ch·∫•m ƒëi·ªÉm ho·∫∑c g·ª≠i d·ªØ li·ªáu v·ªÅ backend
  };

  const formatTime = (seconds) => {
    const minutes = Math.floor(seconds / 60);
    const remainingSeconds = seconds % 60;
    return `${minutes}:${remainingSeconds < 10 ? "0" : ""}${remainingSeconds}`;
  };

  return (
    <div style={{ padding: 20 }}>
      <h2>üìù ƒê·ªÅ thi: {examConfig.examName}</h2>
      <p>
        <strong>Sinh vi√™n:</strong> {studentData.studentName} ({studentData.studentId})
      </p>
      <p><strong>M√£ ƒë·ªÅ:</strong> {studentData.examCode}</p>
      <p><strong>Ph√≤ng thi:</strong> {studentData.roomName}</p>
      <p><strong>S·ªë c√¢u h·ªèi:</strong> {exam.questions} | T·ªïng ƒëi·ªÉm: {exam.totalScore}</p>

      <h3>Th·ªùi gian c√≤n l·∫°i: {formatTime(timeLeft)}</h3>

      <hr />
      <h3>C√¢u h·ªèi</h3>

      {exam.questionsData.map((question, idx) => (
        <div key={idx} style={{ marginBottom: 20 }}>
          <p><strong>C√¢u {idx + 1}:</strong> {question.questionText}</p>
          {["A", "B", "C", "D"].map((label, optIdx) => (
            <div key={optIdx}>
              <label>
                <input
                  type="radio"
                  name={`q-${idx}`}
                  value={label}
                  checked={answers[idx] === label}
                  onChange={() => handleAnswerChange(idx, label)}
                />
